	add("credobaptism", "{\"term\":\"credobaptism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027credo\u0027 (i believe)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Practice of the credobaptists; belief that baptism is only to be administered to those who profess their faith\", \"priority\":1}]}, \"synonyms\":{}}");

	add("credulity", "{\"term\":\"credulity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027credulité\u0027 (French \u0027crédulité\u0027 , from Latin {{m|la|crēdulitās}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A willingness to believe in someone or something in the absence of reasonable proof; credulousness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d306031785\u0026amp;tag\u003dFielding,+Henry,+1707-1754:+The+history+of+Tom+Jones,+a+foundling,+1749\u0026amp;query\u003dcredulity\u0026amp;id\u003dFieTomJ \u0027The history of Tom Jones\u0027, Book 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Do you think Mr. Allworthy hath more contempt for money than other men because he professes more? Such \u0027\u0027credulity\u0027\u0027 would better become one of us weak women, than that wise sex which heaven hath formed for politicians. Indeed, brother, you would make a fine plenipo to negotiate with the French\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, Arthur Conan Doyle, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d277063444\u0026amp;tag\u003dDoyle,+Arthur+Conan:+The+Lost+World,+1912\u0026amp;query\u003dcredulity\u0026amp;id\u003dDoyLost \u0027The Lost World\u0027, ch. 9\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As Challenger spoke of his pterodactyl I glanced at Professor Summerlee, and for the first time I seemed to see some signs of a dawning \u0027\u0027credulity\u0027\u0027 and repentance. There was no sneer upon his thin lips, but, on the contrary, a gray, drawn look of excitement and amazement. Challenger saw it, too, and reveled in the first taste of victory\", \"priority\":5}]}, \"synonyms\":{}}");

	add("credulousness", "{\"term\":\"credulousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic or state of being credulous; credulity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, Ernest Jones, \u0026quot;The Psychopathology of Everyday Life\u0026quot;, \u0027The American Journal of Psychology\u0027, vol. 22 no 4 (Oct), pp. 525-6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Credulousness\u0027\u0027 is always more harshly judged than incredulousness, though they are both merely different aspects of the same fundamental failing, namely, lack of true scepticism\", \"priority\":3}]}, \"synonyms\":{}}");

	add("creed", "{\"term\":\"creed\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) \u0027credo\u0027 \u0027crede\u0027 Old english (ca. 450-1100) \u0027creda\u0027 from Latin \u0027credo|lang\u003dla\u0027 () from \u0027credere\u0027 (to believe) akin to Old Irish \u0027cretim|lang\u003dsga\u0027 () and Sanskrit \u0027रद्दध्मि\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is believed; accepted doctrine, especially religious; a particular set of beliefs; any summary of principles or opinions professed or adhered to\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A reading or statement of belief that summarizes the faith it represents; a definite summary of what is believed; a confession of faith for public use; especially, one which is brief and comprehensive\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027creed\u0027\u0027 is a manifesto of religious or spiritual beliefs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fact of believing; belief, faith\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Lord Byron, \u0027Don Juan\u0027, I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The precipice she stood on was immense, / So was her \u0027\u0027creed\u0027\u0027 in her own innocence\", \"priority\":6}]}, \"synonyms\":{}}");

	add("creel", "{\"term\":\"creel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Uncertain. Possibly from Middle english (1100-1500) \u0027crele\u0027, from a Old french (842-ca. 1400) root *\u0027creille\u0027, variant of \u0027greille\u0027 (compare French \u0027grille\u0027 , from Latin {{m|la|crāticula}}. The English word may also have been of Scottish origin originally.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An osier basket, such as anglers use to hold fish\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, William Henley, \u0027In Fisherrow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Her great \u0027\u0027creel\u0027\u0027 forehead-slung, she wanders nigh\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Easing the heavy strap with gnarled, brown finger\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A bar or set of bars with skewers for holding paying-off bobbins, as in the roving machine, throstle, and mule\", \"priority\":5}]}, \"synonyms\":{}}");

