	add("creepazoid", "{\"term\":\"creepazoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027\u0027 + \u0027\u0027 + \u0027-oid\u0027 possibly as a variant of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A creepy person or creature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, William Bernhardt, \u0027Dark Eye\u0027, Ballantine Books (2006), ISBN 0345470168, [http://books.google.com/books?id\u003d3_6SVu1Na1gC\u0026amp;pg\u003dPA230\u0026amp;dq\u003d%22creepazoid%22 page 230\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"According to this book, the public image of Poe as this ghoulish \u0027\u0027creepazoid\u0027\u0027 is inaccurate. His work was creepy, but he wasn\u0027t.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Robin Benway, \u0027The Extraordinary Secrets of April, May, \u0026amp; June\u0027, Razorbill (2010), ISBN 9781101458945, [http://books.google.com/books?id\u003dL2sugOOK8b8C\u0026amp;pg\u003dPT80\u0026amp;dq\u003d%22creepazoid%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“What sort of stalker \u0027\u0027creepazoid\u0027\u0027 does that\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Anton Strout, \u0027Alchemystic\u0027, Ace (2012), ISBN 9781101589649, [http://books.google.com/books?id\u003dtgr0oXE-m1UC\u0026amp;pg\u003dPT277 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Like hell, I don\u0027t,\u0026quot; he said. \u0026quot;I don\u0027t want to see my roommate get killed. You know how hard it was to find someone who wasn\u0027t a Craigslist \u0027\u0027creepazoid\u0027\u0027 in the first place\", \"priority\":7}]}, \"synonyms\":{}}");

	add("creeper", "{\"term\":\"creeper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|creep|er|lang\u003den}}Slang usage derived from phrase \u0026quot;give the creeps\u0026quot; or \u0026quot;creep out\u0026quot; (distinct from givers from give, or merely one who creeps)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or a thing who crawls or creeps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Burto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Standing waters are most unwholesome, full of mites, \u0027\u0027creepers\u0027\u0027; slimy, muddy, unclean\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Often in plural, a one-piece garment for infants designed to facilitate access to the wearer\u0027s diaper\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A device which allows a small child to safely roam around a room from a seated or standing position\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A metal plate with spikes, designed to be worn with shoes to prevent slipping\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A spur-like device strapped to the boot to facilitate climbing. \u0026lt;!--not same as anti-slip shoe plate above--\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A small, low iron, or dog, between the andirons\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An instrument with iron hooks or claws for dredging up items from a well or other water\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any device for causing material to move steadily from one part of a machine to another, such as an apron in a carding machine, or an inner spiral in a grain screen\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Any plant (as ivy or periwinkle) that grows by creeping; especially a climbing plant of the genus \u0027Parthenocissus\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Then the piglet tore loose from the \u0027\u0027creepers\u0027\u0027 and scurried into the undergrowth\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A treecreeper\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A small, four-hooked grapnel used to recover objects dropped onto the sea bed\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The lowest gear of a tractor or truck, also creeper gear, creeper shift\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A low-profile, wheeled platform whereupon an auto mechanic may lie on their back and gain better access to the underbody of a vehicle\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A person who creep someone creeps people out; a creepy person\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t go to a nightclub to find a boyfriend. They\u0027re all \u0027\u0027creepers\u0027\u0027 there\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A kind of shoe, usually with a suede upper and a thick crepe sole, associated with various twentieth-century subcultures\", \"priority\":19}]}, \"synonyms\":{}}");

	add("creepoid", "{\"term\":\"creepoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|creep|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A creepy person or creature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Lina Jaivin, \u0027Eat Me\u0027, Broadway (1998), ISBN 0553066978, [http://books.google.com/books?id\u003dWMh09ePv1EgC\u0026amp;pg\u003dPA730 page 130\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Did he touch my leg on purpose? \u0027\u0027Creepoid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0026quot;Wired Kids Game and Web site reviews\u0026quot;, \u0027Fort Worth Star-Telegram\u0027, 15 August 2000\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This is the part where we have to warn parents: Just like with comic books, there\u0027s lots of violence and blood and nightmare-inducing villainous \u0027\u0027creepoids\u0027\u0027 here\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mike Prevatt, \u0026quot;[http://www.lasvegasmercury.com/2003/MERC-Nov-20-Thu-2003/22615065.html Holmes\u0027 sweet home]\u0026quot;, \u0027Las Vegas Mercury\u0027, 20 November 2003\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Pieces isn\u0027t a Holmes vehicle like Teaching Mrs. Tingle, if only because the supporting cast has a tendency to outperform her, for better (Lillias White, sharply playing April\u0027s straight-talkin\u0027 neighbor) or worse (an abysmally bad Sean Hayes, as her building\u0027s resident \u0027\u0027creepoid\", \"priority\":7}]}, \"synonyms\":{}}");

	add("creeps", "{\"term\":\"creeps\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fear; anxiety\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I get the \u0027\u0027creeps\u0027\u0027 walking down that street, even in broad daylight\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cremains", "{\"term\":\"cremains\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|cremated|remains|lang\u003den}}. Apparently a euphemism used by undertakers.\u0026lt;ref\u0026gt;\u0027\u00271954\u0027\u0027, \u0027w:Time (magazine)|Time\u0027, Volume 63, Issues 1-13, page 93: The commission\u0027s research turned up such a sign of the times as a crematory that delicately refers to ashes as \u0026quot;cremains.\u0026quot;\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cremated remains of a deceased person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Kathleen Sublette, Martin Flagg, \u0027Final Celebrations: A Guide for Personal and Family Funeral Planning\u0027, page 52\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some people prefer to keep the \u0027\u0027cremains\u0027\u0027 in their homes in a special place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Mugan Sozan Peter Schellin, \u0027Rogue Monk: A Memoir about Zen, Disability, and Work\u0027, page 93\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Paul\u0027s \u0027\u0027cremains\u0027\u0027 arrived by limo service less than an hour before the living room memorial\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Norman L. Cantor, \u0027After We Die: The Life and Times of the Human Cadaver\u0027, page 111\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Because of these remaining bone fragments, the \u0027\u0027cremains\u0027\u0027 must be pulverized to a grainy powder before any scattering of ashes\", \"priority\":7}]}, \"synonyms\":{}}");

	add("crenel", "{\"term\":\"crenel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027crenel\u0027 ( \u0026gt; modern French \u0027créneau\u0027 , diminutive of \u0027cren\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The space between merlons in a crenelated battlement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027A Storm of Swords\u0027, Bantam 2011, p. 44\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They would wake Lord Bolton and search Harrenhal from \u0027\u0027crenel\u0027\u0027 to cellar, and when they did they would find the map and the dagger missing [\u0026amp;hellip\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crenellation", "{\"term\":\"crenellation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{rfe|lang\u003den}}Ultimately from Latin \u0027lang\u003dla\u0027 as a diminutive of \u0027lang\u003dla\u0027 The word also appears in Old french (842-ca. 1400) as \u0027lang\u003dfro|cren\u0027 () or \u0027lang\u003dfro|crener\u0027 () The word shares its origins with the common English word \u0027lang\u003den\u0027 similarly meaning “a small opening, as in a wall or rock face; a crevice”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pattern along the top of a parapet (fortified wall), most often in the form of multiple, regular, rectangular spaces in the top of the wall, through which arrows or other weaponry may be shot, especially as used in medieval European architecture\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of crenellating; adding a top row that looks like the top of a medieval castle\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crenotherapy", "{\"term\":\"crenotherapy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|creno|therapy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The therapeutic use of mud, mineral waters and steam\", \"priority\":1}]}, \"synonyms\":{}}");

