	add("creosol", "{\"term\":\"creosol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The methoxy phenol \u00272-methoxy-4-methylphenol\u0027 that is a constituent of creosote\", \"priority\":1}]}, \"synonyms\":{}}");

