	add("crepitation", "{\"term\":\"crepitation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of crepitating or crackling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1923\u0027\u0027, w:George Allan George Allan England, s:The Thing The Thing from—\u0026quot;Outside\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Silence again, save for the \u0027\u0027crepitation\u0027\u0027 of the flames, the fall of an ember, the murmur of the current\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A grating or crackling sensation or sound, as that produced by rubbing two fragments of a broken bone together, or by pressing upon cellular tissue containing air\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A crepitant rale\", \"priority\":5}]}, \"synonyms\":{}}");

	add("crepitus", "{\"term\":\"crepitus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027crepitus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Grating, crackling or popping sounds and sensations experienced under the skin and joints\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"crepitation\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crepusculum", "{\"term\":\"crepusculum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027crepusculum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"crepuscule; twilight; dus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Earthshine] should appear more splendid and be visible after the \u0027\u0027crepusculum\u0027\u0027 in the dark of night\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cress", "{\"term\":\"cress\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) \u0027cressa\u0027 from West Germanic \u0027*krasjon-\u0027. Cognate with Dutch \u0027kers\u0027 German \u0027kresse\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant of various species, chiefly cruciferous. The leaves have a moderately pungent taste, and are used as a salad and antiscorbutic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crescendi", "{\"term\":\"crescendi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027: Nikolay Rimsky-Korsakov \u0027et alii\u0027, \u0027Principles of orchestration: with musical examples drawn from his own works\u0027, [http://books.google.co.uk/books?id\u003derS-2XR-kPUC\u0026amp;pg\u003dPA112\u0026amp;dq\u003dcrescendi\u0026amp;ei\u003d58nkSeaJIYyykASju4yfDQ page 112] ([http://store.doverpublications.com/0486212661.html DoverPublications.com]; ISBN 0486212661\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Short \u0027\u0027\u0027crescendi\u0027\u0027\u0027 and \u0027diminuendi\u0027 are generally produced by natural dynamic means; when prolonged, they are obtained by this method combined with other orchestral devices. […] Prolonged orchestral \u0027\u0027\u0027crescendi\u0027\u0027\u0027 are obtained by the gradual addition of other instruments in the following order: strings, wood-wind, brass\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027: Hermann Scherchen, Michel D. Calvocoressi [tr.], and Norman Del Mar [prefacer], \u0027Handbook of conducting\u0027, [http://books.google.co.uk/books?id\u003dNdkEMvD10n4C\u0026amp;pg\u003dPA113\u0026amp;dq\u003dcrescendi\u0026amp;ei\u003d58nkSeaJIYyykASju4yfDQ page 113] ([http://www.oup.com/us/catalog/general/subject/?cp\u003d25211\u0026amp;ci\u003d9780198161820 Oxford University Press]; ISBN 0198161824, 9780198161820\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Wrong \u0027\u0027\u0027crescendi\u0027\u0027\u0027, which should be avoided, tend to appear at the end of passages ascending to the apex of melodies\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: Christopher Anderson, \u0027Max Reger and Karl Straube: perspectives on an organ performing tradition\u0027, [http://books.google.co.uk/books?id\u003dTotkWHbc2nkC\u0026amp;pg\u003dPA94\u0026amp;dq\u003dcrescendi\u0026amp;ei\u003d58nkSeaJIYyykASju4yfDQ page 94] ([http://www.ashgate.com/ Ashgate Publishing]; ISBN 0754630757, 9780754630753\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Furthermore, organ builders were at liberty to construct their register \u0027\u0027crescendi\u0027\u0027 so that stops entered either one at a time or in groups of two or more. […] Of course, a sensitive organist would not rely wholly or even predominantly upon a register crescendo to effect stop changes, particularly when those changes had more to do with simple manipulation of tone color than with progressive \u0027\u0027crescendi\", \"priority\":6}]}, \"synonyms\":{}}");

	add("crescent", "{\"term\":\"crescent\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027cressaunt\u0027 from Old french (842-ca. 1400) \u0027creissant\u0027 (crescent of the moon) (French \u0027croissant\u0027 , from Latin {{m|la|crēscēns}}, present active participle of {{m|la|crēscō||arise, thrive}}, from Proto-indo-european {{m|ine-pro|*ker||to grow}}. See Old Armenian \u0027սերիմ\u0027 (be born) and \u0027սերեմ\u0027 (bring forth) Ancient Greek \u0027κόρη\u0027 (girl) and \u0027κούρος\u0027 (boy) Latin \u0027creare\u0027 (produce, create, bring forth) and \u0027ceres\u0027 (goddess of agriculture)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The figure of the moon as it appears in its first or last quarter, with concave and convex edges terminating in points\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something shaped like a crescent, especially\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A curved pastry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A curved street, often presenting a continuous façade, as of row houses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A representation of the symbol used by Islamic caliphates\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A crescent spanner\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any of three orders of knighthood conferred upon foreigners to whom Turkey might be indebted for valuable services\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The emblem of the waxing Moon with horns directed upward, when used in a coat of arms; often used as a mark of cadency to distinguish a second son and his descendants\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A crescentspot butterfly\", \"priority\":9}]}, \"synonyms\":{}}");

	add("crevice", "{\"term\":\"crevice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 from Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 from \u0027lang\u003dfro|crever\u0027 () from Latin \u0027lang\u003dla|crepare\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A narrow crack or fissure, as in a rock or wall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Tennyso\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The mouse, / Behind the moldering wainscot, shrieked, / Or from the \u0027\u0027crevice\u0027\u0027 peered about\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"William Butler Yeat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I can\u0027t tell you how urbane and sprightly the old poll parrot was; and not a pocket, not a \u0027\u0027crevice\u0027\u0027, of pomp, humbug, respectability in him: he was fresh as a daisy\", \"priority\":5}]}, \"synonyms\":{}}");

